<template><div><h1 id="开发者文档-treasuryvault合约" tabindex="-1"><a class="header-anchor" href="#开发者文档-treasuryvault合约"><span>开发者文档：TreasuryVault合约</span></a></h1>
<h2 id="概述" tabindex="-1"><a class="header-anchor" href="#概述"><span>概述</span></a></h2>
<p>TreasuryVault是一个智能合约，用于管理资金的存入、铸造代币、销毁代币以及债务管理。用户可以通过存入ETH来铸造相应的YETH和PT代币，也可以通过销毁这些代币来提取ETH。此外，合约还支持管理借款和还款功能。</p>
<h2 id="合约功能" tabindex="-1"><a class="header-anchor" href="#合约功能"><span>合约功能</span></a></h2>
<ul>
<li><strong>存入ETH并铸造代币</strong>：用户可以存入ETH来铸造YETH和PT代币。</li>
<li><strong>销毁代币并提取ETH</strong>：用户可以销毁YETH和PT代币来提取ETH。</li>
<li><strong>借款管理</strong>：管理员可以指定地址借用合约中的资金。</li>
<li><strong>还款管理</strong>：管理员可以执行还款操作，增加合约的资金。</li>
</ul>
<h2 id="合约变量" tabindex="-1"><a class="header-anchor" href="#合约变量"><span>合约变量</span></a></h2>
<ul>
<li><code v-pre>sellFee</code>：出售代币时的手续费比例。</li>
<li><code v-pre>buyFee</code>：购买代币时的手续费比例。</li>
<li><code v-pre>feeTo</code>：手续费收入接收地址。</li>
<li><code v-pre>total</code>：合约内部使用的变量，具体作用未在文档中说明。</li>
<li><code v-pre>totalDebt</code>：累计债务金额。</li>
<li><code v-pre>totalRepay</code>：累计还款金额。</li>
<li><code v-pre>PToken</code>：PT代币的地址。</li>
<li><code v-pre>YToken</code>：YETH代币的地址。</li>
<li><code v-pre>BaseRate</code>：基础兑换比例，ETH与PT/YETH的兑换基数。</li>
</ul>
<h2 id="事件" tabindex="-1"><a class="header-anchor" href="#事件"><span>事件</span></a></h2>
<ul>
<li><code v-pre>Deposit</code>：当用户存入ETH并铸造代币时触发。</li>
<li><code v-pre>Withdrawal</code>：当用户销毁代币并提取ETH时触发。</li>
<li><code v-pre>Borrow</code>：当管理员执行借款操作时触发。</li>
<li><code v-pre>Repayment</code>：当管理员执行还款操作时触发。</li>
</ul>
<h2 id="函数" tabindex="-1"><a class="header-anchor" href="#函数"><span>函数</span></a></h2>
<h3 id="初始化函数" tabindex="-1"><a class="header-anchor" href="#初始化函数"><span>初始化函数</span></a></h3>
<ul>
<li><code v-pre>initialize(address _ptoken, address _ytoken)</code>：初始化合约，设置PT和YETH代币的地址。</li>
</ul>
<h3 id="存入eth并铸造代币" tabindex="-1"><a class="header-anchor" href="#存入eth并铸造代币"><span>存入ETH并铸造代币</span></a></h3>
<ul>
<li><code v-pre>deposit(uint8 _type)</code>：用户存入ETH并根据_type铸造YETH和PT代币。_type为1时，铸造500YETH和500PT；为2时，铸造1000PT。</li>
</ul>
<h3 id="销毁代币并提取eth" tabindex="-1"><a class="header-anchor" href="#销毁代币并提取eth"><span>销毁代币并提取ETH</span></a></h3>
<ul>
<li><code v-pre>withdraw(uint wad)</code>：用户销毁YETH和PT代币来提取ETH。</li>
</ul>
<h3 id="管理借款和还款" tabindex="-1"><a class="header-anchor" href="#管理借款和还款"><span>管理借款和还款</span></a></h3>
<ul>
<li><code v-pre>borrow(uint256 _amount)</code>：管理员从合约中借用指定金额的资金。</li>
<li><code v-pre>repayment()</code>：管理员执行还款操作，增加合约的资金。</li>
</ul>
<h3 id="更新合约参数" tabindex="-1"><a class="header-anchor" href="#更新合约参数"><span>更新合约参数</span></a></h3>
<ul>
<li><code v-pre>updateSellFee(uint256 _sellFee)</code>：更新出售代币的手续费比例。</li>
<li><code v-pre>updateBuyFee(uint256 _buyFee)</code>：更新购买代币的手续费比例。</li>
<li><code v-pre>updateFeeTo(address _feeTo)</code>：更新手续费收入接收地址。</li>
<li><code v-pre>updatePT(address _pt)</code>：更新PT代币的地址。</li>
<li><code v-pre>updateYT(address _yt)</code>：更新YETH代币的地址。</li>
<li><code v-pre>updateBaseRate(uint256 _base)</code>：更新基础兑换比例。</li>
</ul>
<h3 id="查询函数" tabindex="-1"><a class="header-anchor" href="#查询函数"><span>查询函数</span></a></h3>
<ul>
<li><code v-pre>totalSupply()</code>：返回合约的总供应量。</li>
<li><code v-pre>balance()</code>：返回合约的ETH余额。</li>
</ul>
<h2 id="安全和升级性" tabindex="-1"><a class="header-anchor" href="#安全和升级性"><span>安全和升级性</span></a></h2>
<ul>
<li>合约继承自<code v-pre>ManagerUpgradeable</code>和<code v-pre>PausableUpgradeable</code>，支持权限管理和升级功能。</li>
<li>使用<code v-pre>SafeMath</code>库来防止整数溢出。</li>
</ul>
